import React from 'react';
import { TextInput, TouchableOpacity, View } from 'react-native';
import { faMagnifyingGlass } from '@fortawesome/free-solid-svg-icons';
import { FontAwesomeIcon } from '@fortawesome/react-native-fontawesome';
import { faPenToSquare } from '@fortawesome/free-regular-svg-icons';
import { StackNavigationProp } from '@react-navigation/stack';
import { RootStackParamList } from '../../../App';

import styles from './style';
import Footer from '../../components/Footer/Footer';

type Navigation = {
    navigation: StackNavigationProp<RootStackParamList>;
};

const Community : React.FC<Navigation> = ({navigation}) => {
    return (
        <View style = {styles.container}>
            <View style = {styles.header}>
                <View style = {styles.ctnSearch}>
                    <TouchableOpacity>
                        <FontAwesomeIcon icon = {faMagnifyingGlass} size={20} color='#7d7d80'/>
                    </TouchableOpacity>
                    <TextInput 
                        placeholder='Tìm kiếm'
                        placeholderTextColor='#7d7d80'
                        style = {styles.input}
                    />
                </View>

                <View>
                    <TouchableOpacity>
                        <FontAwesomeIcon icon = {faPenToSquare} size={26} color='#5a5a5a'/>
                    </TouchableOpacity>
                </View>
            </View>

            <Footer navigation={navigation} address={"Cart"}/>
        </View>
    );
};

export default Community;
